  \"2015-12-20T20:57:53.465196\",\n\t\"name\": \"archive-of-geosample-information-from-scientific-ocean-drilling\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Texas A and M University (TAMU), JOIDES
  Resolution Science Operator of the International Ocean Discovery Program (IODP),n
  \         is a partner in the Index to Marine and Lacustrine Geological Samples
  (IMLGS) database, contributing information to the IMLGS to help researchers discover
  geological samples curated in their facility.n          The IODP core repositories
  archive and make available core material from the current IODP, and also from its
  predecessor programs, the n          Deep Sea Drilling Project (DSDP), Ocean Drilling
  Program (ODP), and Integrated Ocean Drilling Program (IODP).  Core material is availablen
  \         to researchers through the IODP Curator.n          TAMU also contributed
  information to the IMLGS describing cores from the former IODP and ODP in their
  role as Science Operator for those programs.  n          Information describing
  DSDP cores for the IMLGS was prepared by the former DSDP data management group operated
  by then          Scripps Institution of Oceanography (SIO).  TAMU periodically sends
  post-moratorium IODP core data, documents, and imagery to NCEI for long-term archive.
  \ The latest IODP data, and n          full-resolution TIFF images are available
  from the Data Librarian at TAMU.  Full-resolution TIFF images in the NCEI archive
  are offline only.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
